import Link from 'next/link';
import Nav from '../components/Nav';

const Index = () => (
    <div>
        <Nav />
        <h2>Hello from Next JS</h2>
        <Link href="/About">
            <a >Go to about</a>
        </Link>

        <p>Lorem ipsum dolor sit amem</p>

        <style jsx>{`
            p {
                color : green;
                font-size: 22px;
            }
        `}</style>
    </div>
);

export default Index;
